import React from "react";
import {
    View, 
    Image
} from "react-native";
import {createBottomTabNavigator, BottomTabBar} from '@react-navigation/bottom-tabs'

import { ViewCompaniesList } from "../screens";

import { COLORS, icons } from "../config";

const Tab = createBottomTabNavigator();

const Tabs = () => {
    return (
        <Tab.Navigator
        tabBarOptions={{
            showLabel: false
        }}>
            <Tab.Screen
                name="ViewCompaniesList"
                component={ViewCompaniesList}
                options={{
                    tabBarIcon: ({focused}) => (
                        <Image
                            source={icons.cutlery}
                            resizeMode="contain"
                            style={{
                                width: 25,
                                height: 25,
                                tintColor: focused ? COLORS.primary : COLORS.secondary
                            }}
                        />
                    )
                }}
            />
        </Tab.Navigator>
    )
}
export default Tabs;
